main_text:
This building, previously known as the HumSS is named after Edith Morley, who was appointed Professor in Reading in 1908 and is believed to be the first woman awarded the title of professor in a British university. 

<br><br>
<h3>What subject was her title in?</h3>

<button class="morley_wrong btn btn-primary">Art</button>
<button class="morley_right btn btn-primary">English</button>
<button class="morley_wrong btn btn-primary">Mathematics</button>
<button class="morley_wrong btn btn-primary">Physics</button>
<button class="morley_wrong btn btn-primary">Psychology</button>

<script>
$(".morley_wrong").on("click", function(){
  bootbox.alert("Nope, try again");
});

$(".morley_right").on("click", function(){
  bootbox.alert("Correct!");
  $("#location_edith_morley").removeClass("btn-secondary")  
    .removeClass("btn-primary")
    .addClass("btn-warning");
});

</script>

