The perfect place for a picnic, full of plants from around the world
<br>
<br>
<h5>Hedge maze</h5>
True or false: There used to be a hedge maze here, but too many students got lost in it while inebriated, so this had to be discontinued? <br>
<br>
<button id="harris_true_button" class="btn btn-primary">True</button>
<button id="harris_false_button"  class="btn btn-primary">False</button>
<script>
$("#harris_true_button").on("click", function(){
  bootbox.alert("We have no evidence of this, so we assume it's false.");
});

$("#harris_false_button").on("click", function(){
  setTimeout(function(){
    $(".sports").show();
  },100);
  bootbox.alert("Correct!");
  $("#location_harris").removeClass("btn-secondary")  
    .removeClass("btn-primary")
    .addClass("btn-warning");
});

</script>
